var b="url",c="لیست_مصاحبه_مصاحبه_کننده_.html",d="generationDate",e=new Date(1764584247545.25),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="currentTime",s="Loginv",t="page",u="packageId",v="4a26377c3cd8408e8636e57890d8bb54",w="type",x="Axure:Page",y="لیست مصاحبه(مصاحبه کننده)",z="notes",A="Page Overview",B="<p><span>یریتاری</span></p>",C="annotations",D="fn",E="1",F="ownerId",G="e06d579abf0a400baf5de77a8425529e",H="label",I="Note",J="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">برای ثیت امتیاز مصاحبه، هر مصاحبه به صورت جداگانه انتخاب گردد.امکان انتخاب بیش از یک مصاحبه برای ثبت امتیاز در هر بار وجود نداشته باشد.در صورت بروز این امر کاربر با پیام خطا مواجه شود:</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">پیام خطا</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FD0000;\">شما بیش از یک مصاحبه را برای ثبت امتیاز انتخاب نموده اید</span></p>",K="2",L="4fecfc8800e04a739c974f5401b722de",M="مشاهده",N="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#404040;\">کاربر قادر باشد با کلیک بر روی گزینه مشاهده، مصاحبه کننده(ها)ی کارجوی مرتبط را مشاهده نماید</span></p>",O="3",P="2cc518a13b3648b783748db54503b9a2",Q="مصاحبه",R="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">مصاحبه کننده با استفاده از این فرم که در کارتابل وی قرار دارد قادر است مشخصات مصاحبه برنامه ریزی شده را مشاهده نماید</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#E600A5;\">مصاحبه کننده ملزم است پس از پایان انجام مصاحبه کارجو، نسبت به ثبت امتیاز و مشاهدات خود نسبت به کارجو اقدام نماید</span></p>",S="4",T="e0e307ef56d944b9b0b1dcd63a157793",U="تایید در مصاحبه تخصص",V="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">با ثبت امتیازات مصاحبه تخصصی کارجو توسط مصاحبه کننده(ها)، نتیجه مصاحبه در این فیلد(فیلد نتیجه مصاحبه تخصصی) بروزرسانی و جهت مصاحبه کننده و واحد جذب و استخدام قابل مشاهده باشد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">همچنین &quot;وضعیت کارجو&quot; در پروفایل وی و در کلیه گریدهای درگیر در فرآیند مصاحبه کارجو بروزرسانی گردد</span></p>",W="5",X="a2d8416df1cc434aa5d209bc823352b3",Y="نتیجه مصاحبه تخصصی",Z="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">نتیجه مصاحبه تخصصی کارجو</span></p>",ba="6",bb="e63cf9dff85c47e783eb46c0376b156b",bc="امتیاز م ت",bd="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">امتیاز نهایی مصاحبه تخصصی کارجو</span></p>",be="7",bf="0d1dd99d65744a2294cf1367fabe37db",bg="(Droplist)",bh="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#140F4F;\">چنانچه کارجو بدون آنکه مصاحبه را لغو نموده باشد در مصاحبه تخصصی حاضر نشد وضعیت وی چنانچه مصاحبه به صورت انفرادی است توسط مصاحبه کننده و چنانچه مصاحبه به صورت تیمی است توسط &quot;دبیر کارگروه مصاحبه تیمی&quot; به وضعیت &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FB0404;\">عدم حضور در مصاحبه تخصصی</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#140F4F;\">&quot; تغییر یافته و در کلیه گریدهای درگیر بر روی وضعیت کارجو نیز بروزرسانی گردد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#140F4F;\"><br></span></p>",bi="8",bj="c3f081a1b1eb4ad9810d071555c95b9c",bk="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورت حضور کارجو در مصاحبه تخصصی و ثبت امتیاز توسط هر یک از مصاحبه کنندگان(ثبت امتیاز کارجو به منزله حضور او در&nbsp; مصاحبه هم می باشد) فیلد &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">حضور در مصاحبه</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; به صورت اتوماتیک به &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF00BF;\">در مصاحبه حاضر شد</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; تغییر یابد</span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p><p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\"><br></span></p>",bl="9",bm="6fc616e2d2e74767930c47a8c357a388",bn="10",bo="c92f5bfa354e4e3ea8aa38de6cc61f49",bp="تایید نتیجه مصاحبه",bq="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">گزینه &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">تایید نتیجه مصاحبه</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; تنها در صورتی قابل نمایش باشد که کاربر لاگین شده در سیستم دارای نقش &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#FF0000;\">دبیر مصاحبه</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; باشد .برای دیگر مصاحبه کنندگان که دارای نقش &quot;دبیر مصاحبه&quot; نمی باشند گزینه &quot;تایید نتیجه مصاحبه&quot; در دسترس نباشد</span></p>",br="11",bs="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">توجه گردد تنها کارجویانی که فیلد &quot;نتیجه مصاحبه تخصصی&quot; آنان در وضعیت &quot;تایید در مصاحبه تخصصی&quot; قررا دارد را می توان با استفاده از گزینه &quot;تایید نتیجه مصاحبه&quot; بررسی و مورد تایید نهایی قرار داد</span></p>",bt="style",bu="baseStyle",bv="627587b6038d43cca051c114ac41ad32",bw="pageAlignment",bx="center",by="fill",bz="fillType",bA="solid",bB="color",bC=0xFFFFFFFF,bD="image",bE="imageAlignment",bF="near",bG="imageRepeat",bH="auto",bI="favicon",bJ="sketchFactor",bK="0",bL="colorStyle",bM="appliedColor",bN="fontName",bO="Applied Font",bP="borderWidth",bQ="borderVisibility",bR="borderFill",bS=0xFF797979,bT="cornerRadius",bU="cornerVisibility",bV="outerShadow",bW="on",bX=false,bY="offsetX",bZ=5,ca="offsetY",cb="blurRadius",cc="spread",cd="r",ce=0,cf="g",cg="b",ch="a",ci=0.349019607843137,cj="adaptiveStyles",ck="interactionMap",cl="onLoad",cm="eventType",cn="OnPageLoad",co="description",cp="Page Loaded",cq="cases",cr="Case 1",cs="conditionString",ct="if value of Loginv equals &quot;1&quot;",cu="isNewIfGroup",cv="caseColorHex",cw="AB68FF",cx="condition",cy="exprType",cz="binaryOp",cA="op",cB="==",cC="leftExpr",cD="fcall",cE="functionName",cF="GetGlobalVariableValue",cG="arguments",cH="globalVariableLiteral",cI="variableName",cJ="rightExpr",cK="stringLiteral",cL="value",cM="stos",cN="actions",cO="action",cP="setPanelState",cQ="Set dp35 to&nbsp; to State2 ",cR="displayName",cS="Set Panel State",cT="actionInfoDescriptions",cU="dp35 to State2",cV="Set dp35 to  to State2 ",cW="panelsToStates",cX="panelPath"